            darkMode: 'class',
            theme: {
                extend: {
                    colors: { gold: '#f59e0b', dark: '#020617', surface: '#1e293b' },
                    fontFamily: { sans: ['Montserrat', 'sans-serif'] },
                    animation: { 'bounce-slow': 'bounce 3s infinite' }
                }
            }
        }
        
        function downloadVCard() {
            // Simple VCard Generation
            const vcard = "BEGIN:VCARD\nVERSION:3.0\nFN:Rafael Sousa\nTITLE:Marketing e Negócios\nNOTE:Estrategista Digital e Mentor de Negócios. Ajudo você a escalar seus resultados.\nEND:VCARD";
            const blob = new Blob([vcard], { type: 'text/vcard' });
            const url = URL.createObjectURL(blob);
            const a = document.createElement('a');
            a.href = url;
            a.download = 'contato.vcf';
            a.click();
        }
    </script>
